        #endregion
        System.Console.WriteLine("Starting CSV Processing...\n");
        //Read CSV file in chunks and process each chunk in parallel
        using (StreamReader sr = new StreamReader(Shared.FilePath))
        {
            //Variable to hold each line and line number
            string? line;
            int lineNumber = 0;

            //Create a list to hold the current chunk
            List<string> chunk = new List<string>();

            //Create a list to hold threads
            List<Thread> threads = new List<Thread>();
            int threadCount = 0;

            //Create a semaphore to limit the number of concurrent threads
            Semaphore semaphore = new Semaphore(Shared.MaxConcurrentThreads, Shared.MaxConcurrentThreads);


            //Read each line from the CSV file
            while ((line = sr.ReadLine()) != null)
            {
                //Skip the iteration if the line is empty
                if (string.IsNullOrEmpty(line))
                    continue;
                //Line is not empty, add it to the chunk and increment line number
                lineNumber++;
                chunk.Add(line);
                //If chunk size is reached, process the chunk in parallel
                if (lineNumber % Shared.ChunkSize == 0)
                {
                    //Increment thread count
                    threadCount++;
                    //Create a copy of the chunk to avoid modification issues
                    List<string> chunkCopy = chunk.Select(x => x).ToList();
                    //Create chunk name
                    string chunkName = $"Chunk-{threadCount}";
                    //Create a new thread to process the chunk
                    Thread thread = new Thread(() =>
                    {
                        semaphore.WaitOne(); //Wait for semaphore
                        try
                        {
                            //Invoke DataProcessor
                            InvokeDataProcessor(chunkName, chunkCopy);
                        }
                        catch (Exception ex)
                        {
                            System.Console.WriteLine($"Error processing {chunkName}: {ex.Message}");
                        }
                        finally
                        {
                            semaphore.Release();//Release semaphore
                        }
                        
                    });
                    //Add thread to the Threads list
                    threads.Add(thread);
                    //Start the thread
                    thread.Start();
                    //Clear the chunk for the next set of lines
                    chunk.Clear();
                }
            }

            //Process the last chunk if it has any remaining lines
            if (chunk.Count > 0)
            {
                threadCount++;
                string chunkName = $"Chunk-{threadCount}";
                Thread thread = new Thread(() =>
                {
                    InvokeDataProcessor(chunkName, chunk);
                });
                threads.Add(thread);
                thread.Start();
                //chunk.Clear();
            }

            //Wait for all threads to complete
            foreach (Thread thread in threads)
            {
                thread.Join();
            }
        }
        Console.WriteLine("\nAll CVS lines Processed.");//End of Main
    }
    //A method to invoke DataProcessor
    static void InvokeDataProcessor(string chunkName, List<string> chunk)
    {
        //Create an instance of DataProcessor and process the chunk
        DataProcessor dataProcessor = new DataProcessor() { ChunkName = chunkName, Chunk = chunk };
        System.Console.WriteLine($"Processing {dataProcessor.ChunkName} of size: {dataProcessor.Chunk.Count}");
        dataProcessor.ProcessChunk();
        //Print out
        lock (Shared.LockObject)
        {
            System.Console.WriteLine($"\nProcessed {dataProcessor.ChunkName} of size: {dataProcessor.Chunk.Count}");
            foreach (var kvp in dataProcessor.GenderCounts)
            {
                System.Console.WriteLine($"{kvp.Key}: {kvp.Value}");
            }
        }
    }
